import Names from "./Names";
import Age from "./Age";
import { BrowserRouter as Router, Switch, Link, Route } from "react-router-dom";
import "./App.css";

function App() {
  return (
    <Router>
      <div className="nav">
        <h1>
          <Link to="/"> na </Link>
        </h1>
        <h1>
          <Link to="/another"> ag</Link>
        </h1>
      </div>
      <Switch>
        <Route path="/" exact component={Names} />
        <Route path="/another" component={Age} />
      </Switch>
    </Router>
  );
}

export default App;
